[rowkey]
        order=random
        component.0.type=timestamp
        component.1.type=integer
        component.1.format=".%010lld"
        component.1.min=5
        component.1.max=9
[source.qualifier]
        type=string
        size=32
        charset="0123456789ABCDEF"
[source.value]
        size=40
        source=/usr/share/dict/words
